import React,{useState,useEffect} from"react"
import axios from "axios";
import { useParams } from 'react-router-dom';
import { Link } from "react-router-dom";

export default function VehiDe(){

    const{id}=useParams();

    const [vehicle, setVehicles] = useState([]);

    const getVehicle = () => {
        axios.get('http://localhost:6060/Vehicle/get/'+id)
        .then((res) => {
            console.log(res.data);
            setVehicles(res.data.Vehicle);
            
        })
        .catch((err) => {
            alert(err.message);
        });    
        
    };

    useEffect(() => {
        getVehicle();
        
    }, []);


    return(
        <div className="dii">
        <div className="vehicle-details-container1">
      <div className="vehicle-info1">
        <div className="reg-number1">{vehicle.regnumber}</div>
      </div>
      <div className="vehicle-info1">
        <div>
          <p className="detail1"><strong className="st">Model:</strong> {vehicle.model}</p>
          <p className="detail1"><strong className="st">Brand:</strong> {vehicle.brand}</p>
          <p className="detail1"><strong className="st">Year:</strong> {vehicle.year}</p>
        </div>
        <div>
          <p className="detail1"><strong className="st">Type:</strong> {vehicle.type}</p>
          <p className="detail1"><strong className="st">Fuel Type:</strong> {vehicle.fueltype}</p>
          <p className="detail1"><strong className="st">Available:</strong> {vehicle.available}</p>
        </div>
        <div>
          <p className="detail1"><strong className="st">Seats:</strong> {vehicle.features}</p>
          <p className="detail1"><strong className="st">Transmission:</strong> {vehicle.transmission}</p>
          <p className="detail1"><strong className="st">Per day Rs:</strong>  {vehicle.priceperday}.00</p>
          {/* Include other details similarly */}
        </div>
        {/* Repeat this structure for additional vehicle components */}
      </div>
    </div>
    <div className="veh">
        <div >
          <img className="img" style={{width:"100%"}} src={`http://localhost:6060/images/${vehicle.image}`} alt="Vehicle" />

        </div>

    </div>
    <div style={{width:"100%",justifyContent:"center"}}>
        
    <form class="booking-form" style={{width:"30%"}}>
        <div class="form-group">
            <label for="pickupDate">Pickup Date:</label>
            <input class="form-control" type="date" id="pickupDate" name="pickupDate" required/>
        </div>
        <div class="form-group">
            <label for="returnDate">Return Date:</label>
            <input class="form-control" type="date" id="returnDate" name="returnDate" required/>
        </div>
        <div class="form-group">
            <label for="contactNumber">Contact Number:</label>
            <input class="form-control" type="tel" id="contactNumber" name="contactNumber" required/>
        </div>
        <div class="form-group">
            <label for="additionalRequirement">Additional Requirements:</label>
            <textarea class="form-control" id="additionalRequirement" name="additionalRequirement" rows="4"></textarea>
        </div>
        <div class="form-group">
            <label for="driverLicenseNumber">Driver's License Number:</label>
            <input class="form-control" type="text" id="driverLicenseNumber" name="driverLicenseNumber" required/>
        </div>
        <div class="form-group">
            <button class="form-control" type="submit">Book Car</button>
        </div>
    </form>

    </div>
    </div>
    )
}
